import React from 'react';

export const Prizes = (): JSX.Element => {

  const winners = [
    {
      round: "Round 1",
      closest: "",
      skins: [],
    },
    {
      round: "Round 2",
      closest: "",
      skins: [],   
    },
    {
      round: "Round 3",
      closest: "",
      skins: [],
    },
    {
      round: "Round 4",
      closest: "",
      skins: [],
    },
  ]

  const winnerData = winners.map(event => {

    const skinsData = event.skins.map(skin => {
      return (
        <div>
          <p>{skin}</p>
        </div>
      )
    })

    return (
    <div key={event.round} className="rounded overflow-hidden shadow-lg w-1/2 m-4 bg-lightCyan">
      <div className="font-bold mb-2 text-darkBlue md:text-xl">{event.round}</div>
      <p className="text-darkBlue text-base"><strong>Closest to the Pin:</strong> {event.closest}</p>
      <p className="text-darkBlue text-base"><strong>Skins:</strong></p>
      {skinsData}
    </div>
    )
  })

  return (
    <div className="flex flex-col justify-center bg-babyPowder h-screen w-screen">
      {winnerData}
    </div>
  );
}
